import React from 'react';

const ImageLinkForm = () => {
	return (
		<nav className = "tc">
			  <div>
				  <label htmlFor='fname'></label>
				  <input type='text' id='fname' name='fname' />
				  <input type='submit' value='Submit' />
			  </div>

		</nav>
	)
}

export default ImageLinkForm;
